package br.com.elvisassis.dslist.dto;import br.com.elvisassis.dslist.entities.GameList;import br.com.elvisassis.dslist.mapprers.GamerListMapper;import java.util.Objects;public class GameListDTO {    private Long id;    private String name;    public GameList toEntity(GameListDTO game) {        return GamerListMapper.INSTANCE.toEntity(this);    }    public GameListDTO() {    }    public GameListDTO(GameList entitty) {        this.id = entitty.getId();        this.name = entitty.getName();    }    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    @Override    public boolean equals(Object o) {        if (!(o instanceof GameListDTO that)) return false;        return Objects.equals(getId(), that.getId());    }    @Override    public int hashCode() {        return Objects.hashCode(getId());    }}